import React from "react";
import style from "../style/body.module.css";
import { Container } from "react-bootstrap";

const Footer = () => {
  return (
    <Container>
      <div className={style._footer}>
        <p>&copy; 2022 Corporate. All Right Reserved.</p>
      </div>
    </Container>
  );
};

export default Footer;
